import React from "react";
import { useNavigate } from "react-router-dom";




export default function Navbar({ fixed }) {
    const navigate = useNavigate();
    const [navbarOpen, setNavbarOpen] = React.useState(false);
    return (
        <>
            <nav className="relative flex flex-wrap items-center justify-between px-2 py-3 bg-indigo-500 mb-3">
                <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
                    <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
                        <a
                            className="text-sm font-bold leading-relaxed inline-block mr-4 py-2 whitespace-nowrap uppercase text-white"
                            href="#pablo"
                        >
                            Portfolio Management
                        </a>
                        <button
                            className="text-white cursor-pointer text-xl leading-none px-3 py-1 border border-solid border-transparent rounded bg-transparent block lg:hidden outline-none focus:outline-none"
                            type="button"
                            onClick={() => setNavbarOpen(!navbarOpen)}
                        >
                            <i className="fas fa-bars"></i>
                        </button>
                    </div>
                    <div
                        className={
                            "lg:flex flex-grow items-center" +
                            (navbarOpen ? " flex" : " hidden")
                        }
                        id="example-navbar-danger"
                    >
                        <ul className="flex flex-col lg:flex-row list-none lg:ml-auto">
                            <li
                                className="nav-item"
                                onClick={(e) => {
                                    e.preventDefault();
                                    navigate("/profile");
                                }}
                            >

                                <a
                                    className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                                    href="#pablo"
                                >
                                    <i className="fab fa-facebook-square text-lg leading-lg text-white opacity-75"></i><span className="ml-2">Profile</span>
                                </a>
                            </li>
                            <li className="nav-item"
                                onClick={(e) => {
                                    e.preventDefault();
                                    navigate("/buylist");
                                }}>
                                <a
                                    className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                                    href="#pablo"
                                >
                                    <i className="fab fa-facebook-square text-lg leading-lg text-white opacity-75"></i><span className="ml-2">Buy</span>
                                </a>
                            </li>
                            <li className="nav-item"
                            >
                                <a
                                    className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                                    href="#pablo"
                                >
                                    <i className="fab fa-twitter text-lg leading-lg text-white opacity-75"></i><span className="ml-2">Sell</span>
                                </a>
                            </li>
                            {sessionStorage.getItem("User") ? (
                                <li className="nav-item"
                                    onClick={(e) => {
                                        e.preventDefault();
                                        sessionStorage.removeItem("User");
                                        navigate("/login");
                                    }}>
                                    <a
                                        className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                                        href="#pablo"
                                    >
                                        <i className="fab fa-pinterest text-lg leading-lg text-white opacity-75"></i><span className="ml-2">LogOut</span>
                                    </a>
                                </li>) : null}
                            {!sessionStorage.getItem("User") ? (
                                <li
                                    className="nav-item"
                                    onClick={(e) => {
                                        e.preventDefault();
                                        navigate("/login");
                                    }}
                                >
                                    <a className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                                        href="#pablo"
                                    >
                                        <i className="fab fa-pinterest text-lg leading-lg text-white opacity-75"></i><span className="ml-2">SignIn</span>
                                    </a>

                                </li>) : null}
                            {!sessionStorage.getItem("User") ? (
                                <li
                                    className="nav-item"
                                    onClick={(e) => {
                                        e.preventDefault();
                                        navigate("/register");
                                    }}
                                >
                                    <a className="px-3 py-2 flex items-center text-xs uppercase font-bold leading-snug text-white hover:opacity-75"
                                        href="#pablo"
                                    >
                                        <i className="fab fa-pinterest text-lg leading-lg text-white opacity-75"></i><span className="ml-2">Register</span>
                                    </a>

                                </li>) : null}
                        </ul>
                    </div>
                </div>
            </nav>
        </>
    );
}
